oxy_webhelp_navlinks = {"ahv_ods-d22872e19136":{"topics":[{"title":"Taking an on-demand snapshot of an AHV virtual machine","shortdesc":"<p class=\"shortdesc\">Take an on-demand snapshot of a specific AHV virtual machine and assign an SLA Domain         to that snapshot. The retention, replication, and archiving settings of the SLA Domain are         applied to the snapshot to protect the virtual machine effectively.<\/p>","href":"nutanix_ahv\/ahv_taking_ods.html","attributes":{"data-id":"ahv_taking_ods"},"menu":{"hasChildren":false},"tocID":"ahv_taking_ods-d22872e19147","topics":[]}]}};